import React, { Component } from 'react';
import { Icon } from 'semantic-ui-react';


class SearchIcon extends Component {
	render() {
		return (
			<NativeListener onClick={(e) => this.props.handleClick(e)}>
				<Icon name='search' link/>
			</NativeListener>
		)
	}
}

export default SearchIcon;
